description:
Let the principle once be established in the United States that the church may employ or control the power of the state; that religious observances may be enforced by secular laws... and the triumph of Rome in this country is assured.  {GC 581.1}  
While the Protestant world is by her attitude making concessions to Rome, let us arouse to comprehend the situation and view the contest before us in its true bearings.  {5T 716.2}  
It is a solemn statement that I make to the church, that not one in twenty whose names are registered upon the church books are prepared to close their earthly history, and would be as verily without God and without hope in the world as the common sinner. {ChS 41.1}
I saw that there is not one in twenty of the youth who knows what experimental religion is. {MYP 383.3}
The time is not far off when the people of God will be called upon to give their testimony before the rulers of the earth. Not one in twenty has a realization of what rapid strides we are making toward the great crisis in our history...There is no time for vanity, for trifling, for engaging the mind in unimportant matters.  {OHC 355.2}
